import React from 'react';
import {Link} from 'react-router-dom';

const Register = () => {
    const onClickHandler = (event) => {
        event.preventDefault();
    }

    return (
        <>
            <h3>Create an account</h3>
            <form>
                <label htmlFor='email'>email address: </label>
                <input type='text' id='email' name='email' />
                <label htmlFor='regpwd'>password: </label>
                <input type='password' id='regpwd' name='regpwd' />
                <label>(Create a password at least 8 characters long, including uppercase and lowercase letters, numbers, and a special character (e.g., $ ! @ #).</label>
                <input type='submit' value='Submit' onClick={onClickHandler} />
            </form>
            <p>Click <Link to='/account/login'>here</Link> to log in.</p>
        </>
    );
}

export default Register;
